(1, 'HTML5 - CSS', 'Fundamentos de HTML5 y CSS', '2019-03-07', '08:00:00', , 'Este curso está diseñado para ilustrar, de forma introductoria, los elementos básicos necesarios para comenzar a construir, estructurar y dar estilo a una página web. Además de presentar una iniciación al uso de HTML para definir los elementos de la página y de CSS para personalizar su estilo, también cubre nuevos aspectos muy utilizados incluidos en las versiones más recientes: HTML5 y CSS3, por lo que este curso te será útil ya sea que quieras iniciarte en estos tópicos o refrescar tus conocimientos.', 'Auditorio FAC. Ing. SISTEMAS - UNICA', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3869.8313300585573!2d-75.73570348521696!3d-14.087132190131062!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x9110e28a8ad5a9bf%3A0xb3869e7db6ef2c93!2sUniversidad+Nacional+San+Luis+Gonzaga+de+Ica!5e0!3m2!1ses!2spe!4v1552870478194\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', 'FINALIZADO');
